
(function(){
  console.log('app.js loaded');
  const META = {"numeric_cols":["Administrative","Administrative_Duration","Informational","Informational_Duration","ProductRelated","ProductRelated_Duration","BounceRates","ExitRates","PageValues","SpecialDay","OperatingSystems","Browser","Region","TrafficType"],"numeric_means":[2.327694090382387,82.6661182227394,0.49860950173812285,34.6491016510197,31.594090382387023,1191.4239225629424,0.022330387975202783,0.04328638825654693,6.033228121050754,0.06099652375434532,2.121784472769409,2.347856315179606,3.1611819235225957,4.033951332560834],"numeric_scales":[3.320034362866441,181.48165588089404,1.2784642489814184,141.91206290137126,43.25868602268197,1813.2839468158259,0.04861477643299645,0.048761973126549014,18.842859553190085,0.1984095013633493,0.9139706529615772,1.7042559819827776,2.407664373203909,4.000913167196179],"categorical_cols":["Month","VisitorType","Weekend"],"categorical_levels":{"Month":["Aug","Dec","Feb","Jul","June","Mar","May","Nov","Oct","Sep"],"VisitorType":["New_Visitor","Other","Returning_Visitor"],"Weekend":["False","True"]},"feature_order":["num__Administrative","num__Administrative_Duration","num__Informational","num__Informational_Duration","num__ProductRelated","num__ProductRelated_Duration","num__BounceRates","num__ExitRates","num__PageValues","num__SpecialDay","num__OperatingSystems","num__Browser","num__Region","num__TrafficType","cat__Month_Aug","cat__Month_Dec","cat__Month_Feb","cat__Month_Jul","cat__Month_June","cat__Month_Mar","cat__Month_May","cat__Month_Nov","cat__Month_Oct","cat__Month_Sep","cat__VisitorType_New_Visitor","cat__VisitorType_Other","cat__VisitorType_Returning_Visitor","cat__Weekend_False","cat__Weekend_True"],"threshold":0.67,"numeric_defaults":{"Administrative":2.327694090382387,"Administrative_Duration":82.6661182227394,"Informational":0.49860950173812285,"Informational_Duration":34.6491016510197,"ProductRelated":31.594090382387023,"ProductRelated_Duration":1191.4239225629424,"BounceRates":0.022330387975202783,"ExitRates":0.04328638825654693,"PageValues":6.033228121050754,"SpecialDay":0.06099652375434532,"OperatingSystems":2.121784472769409,"Browser":2.347856315179606,"Region":3.1611819235225957,"TrafficType":4.033951332560834},"categorical_defaults":{"Month":"Aug","VisitorType":"New_Visitor","Weekend":"False"}};
  const THRESH = 0.670000;
  const MODEL_B64 = "";

  const errBox = document.getElementById('err');
  const thrInput = document.getElementById('thrInput');
  if (thrInput) {
    const t = Number.isFinite(THRESH) ? THRESH : 0.5;
    thrInput.value = t.toFixed(2);
  }
  if (errBox) errBox.textContent = '';
  const showErr = (e)=>{ const m=(e&&e.message)?e.message:String(e); errBox.textContent=m; console.error(e); };

  try {
    const grid = document.getElementById('inputs');
    const el = (t,a={},ch=[])=>{ const x=document.createElement(t); for(const[k,v]of Object.entries(a)){k==='text'?x.textContent=v:x.setAttribute(k,v)} ch.forEach(c=>x.appendChild(c)); return x; };
    if(!grid) throw new Error('inputs container not found');
    let built = 0;
    for (const n of META.numeric_cols) {
      const defv=(META.numeric_defaults||{})[n] ?? 0;
      grid.appendChild(el('div',{class:'card'},[
        el('label',{for:n,text:n}),
        el('input',{type:'number',id:n,value:String(defv),step:'any'})
      ]));
      built++;
    }
    for (const c of META.categorical_cols) {
      const wrap=el('div',{class:'card'});
      wrap.appendChild(el('label',{for:c,text:c}));
      const sel=el('select',{id:c});
      const levels=(META.categorical_levels && META.categorical_levels[c]) || [];
      const defc=(META.categorical_defaults||{})[c];
      for (const o of levels) {
        const opt=el('option',{value:String(o),text:String(o)});
        if(String(o)===String(defc)) opt.selected=true;
        sel.appendChild(opt);
      }
      wrap.appendChild(sel); grid.appendChild(wrap);
      built++;
    }
    if (errBox && built===0) { errBox.textContent='Warning: no inputs rendered.'; }
  } catch(e) {
    if (errBox) errBox.textContent = 'Init error: ' + (e && e.message ? e.message : String(e));
    console.error('Init error', e);
  }

  // Populate legacy threshold label if present
  const thrLabel = document.getElementById('thr');
  if (thrLabel && Number.isFinite(THRESH)) {
    thrLabel.textContent = THRESH.toFixed(2);
  }

  const b64ToU8 = (b64)=>{ const bin=atob(b64); const u8=new Uint8Array(bin.length); for(let i=0;i<bin.length;i++) u8[i]=bin.charCodeAt(i); return u8; };

  if (!window.ort) { showErr('onnxruntime-web not loaded. In Kaggle, turn Internet ON.'); return; }
  ort.env.wasm.wasmPaths='https://cdn.jsdelivr.net/npm/onnxruntime-web@1.19.2/dist/';

  let session;
  const btn = document.getElementById('predictBtn');
  if (btn) { btn.disabled = true; btn.textContent = 'Loading...'; }
  (async()=>{ try {
      session = await ort.InferenceSession.create(b64ToU8(MODEL_B64), { executionProviders: ['wasm'] });
      if (btn) { btn.disabled = false; btn.textContent = 'Predict'; }
    } catch(e) { showErr(e); }
  })();

  // ----- Preset examples -----
  const EXAMPLES = {
    purchase_hi: {
      Administrative: 2, Administrative_Duration: 80,
      Informational: 0, Informational_Duration: 0,
      ProductRelated: 40, ProductRelated_Duration: 6000,
      BounceRates: 0.01, ExitRates: 0.01, PageValues: 1.20,
      SpecialDay: 0.0, OperatingSystems: 2, Browser: 2,
      Region: 4, TrafficType: 2, Month: 'Nov',
      VisitorType: 'Returning_Visitor', Weekend: 'False'
    },
    no_purchase_bounce: {
      Administrative: 0, Administrative_Duration: 0,
      Informational: 0, Informational_Duration: 0,
      ProductRelated: 0, ProductRelated_Duration: 0,
      BounceRates: 0.80, ExitRates: 0.35, PageValues: 0.00,
      SpecialDay: 0.0, OperatingSystems: 2, Browser: 1,
      Region: 1, TrafficType: 3, Month: 'May',
      VisitorType: 'New_Visitor', Weekend: 'True'
    },
    research_maybe: {
      Administrative: 1, Administrative_Duration: 30,
      Informational: 2, Informational_Duration: 120,
      ProductRelated: 10, ProductRelated_Duration: 1200,
      BounceRates: 0.25, ExitRates: 0.05, PageValues: 0.15,
      SpecialDay: 0.0, OperatingSystems: 3, Browser: 3,
      Region: 3, TrafficType: 4, Month: 'Aug',
      VisitorType: 'Returning_Visitor', Weekend: 'False'
    }
  };

  function applyExample(obj){
    for (const [k,v] of Object.entries(obj)){
      const node = document.getElementById(k);
      if (!node) continue;
      node.value = String(v);
    }
  }
  function resetToDefaults(){
    for (const n of META.numeric_cols){
      const defv=(META.numeric_defaults||{})[n] ?? 0;
      const node=document.getElementById(n); if(node) node.value = String(defv);
    }
    for (const c of META.categorical_cols){
      const defc=(META.categorical_defaults||{})[c];
      const node=document.getElementById(c); if(node) node.value = String(defc);
    }
    if (errBox) errBox.textContent='';
    const probEl=document.getElementById('prob'); if (probEl) probEl.textContent='';
    const clsEl=document.getElementById('cls'); if (clsEl) clsEl.textContent='';
  }

  const exSel = document.getElementById('exampleSelect');
  const loadBtn = document.getElementById('loadBtn');
  const loadPredictBtn = document.getElementById('loadPredictBtn');
  const resetBtn = document.getElementById('resetBtn');
  if (loadBtn && exSel) {
    loadBtn.addEventListener('click', ()=>{
      const key = exSel.value;
      applyExample(EXAMPLES[key]||{});
      if (errBox) errBox.textContent='';
    });
  }
  if (loadPredictBtn && exSel) {
    loadPredictBtn.addEventListener('click', async ()=>{
      const key = exSel.value;
      applyExample(EXAMPLES[key]||{});
      await predict();
    });
  }
  if (resetBtn) {
    resetBtn.addEventListener('click', resetToDefaults);
  }

  const buildVec = ()=>{
    const vec = new Float32Array(META.feature_order.length).fill(0);
    const mean  = Object.fromEntries(META.numeric_cols.map((k,i)=>[k, META.numeric_means[i]]));
    const scale = Object.fromEntries(META.numeric_cols.map((k,i)=>[k, META.numeric_scales[i]]));

    for (let i=0; i<META.feature_order.length; i++) {
      const name = META.feature_order[i];

      if (name.startsWith('num__')) {
        // numeric feature passed through StandardScaler
        const raw = name.slice(5); // after 'num__'
        const elNum = document.getElementById(raw);
        if (!elNum) { throw new Error(`Missing numeric input #${raw}`); }
        const rawVal = parseFloat(elNum.value || '0');
        const z = (rawVal - (mean[raw]||0)) / (scale[raw]||1);
        vec[i] = Number.isFinite(z) ? z : 0;

      } else if (name.startsWith('cat__')) {
        // one-hot: 'cat__Month_Aug' -> raw='Month', want='Aug'
        const rest = name.slice(5);
        const us = rest.indexOf('_');
        const raw = us>=0 ? rest.substring(0, us) : rest;
        const want = us>=0 ? rest.substring(us+1) : '';
        const elCat = document.getElementById(raw);
        if (!elCat) { throw new Error(`Missing categorical input #${raw}`); }
        const cur = String(elCat.value);
        vec[i] = (cur === want) ? 1 : 0;

      } else {
        // Fallback if prefixes were not present
        if (META.numeric_cols.includes(name)) {
          const elNum = document.getElementById(name);
          if (!elNum) { throw new Error(`Missing numeric input #${name}`); }
          const rawVal = parseFloat(elNum.value || '0');
          const z = (rawVal - (mean[name]||0)) / (scale[name]||1);
          vec[i] = Number.isFinite(z) ? z : 0;
        } else {
          const us = name.indexOf('_');
          const raw = us>=0 ? name.substring(0, us) : name;
          const want = us>=0 ? name.substring(us+1) : '';
          const elCat = document.getElementById(raw);
          if (!elCat) { throw new Error(`Missing categorical input #${raw}`); }
          const cur = String(elCat.value);
          vec[i] = (cur === want) ? 1 : 0;
        }
      }
    }
    return vec;
  };

  async function predict(){
    errBox.textContent='';
    try {
      if(!session) { showErr('Model is loading click Predict again in a second.'); return; }
      const x=buildVec();
      const out=await session.run({ input:new ort.Tensor('float32', x, [1,x.length]) });
      const logit=out.logits.data[0];
      const prob=1/(1+Math.exp(-logit));
      document.getElementById('prob').textContent=prob.toFixed(3);
      const thrParsed = parseFloat(thrInput && thrInput.value ? thrInput.value : String(THRESH));
      const thr = Number.isFinite(thrParsed) ? thrParsed : THRESH;
      document.getElementById('cls').textContent=(prob>=thr)?'Purchase':'NoPurchase';
    } catch(e) { showErr(e); }
  }
  document.getElementById('predictBtn').addEventListener('click', predict);
})();
